// 設置74HC4051多路開關的控制端
const int S0 = 2;
const int S1 = 3;
const int S2 = 4;

// 設置三個MAX6675模組的CS腳
const int zOutput = A1; // Connect common (Z) to 5 (PWM-capable)
//const int zInput = A0; // Connect common (Z) to 5 (PWM-capable)

//MAX6675* thermocouples[8];  // 溫度傳感器指標陣列

#define _SCK 13
//#define _CS  A0
#define _SO  12
static volatile uint8_t is_tc_open;

void max6675_init()
{
  pinMode( _SCK, OUTPUT );
  pinMode( _SO, INPUT );
  pinMode( zOutput, OUTPUT );
  //  pinMode( zInput, INPUT );
  digitalWrite( zOutput, HIGH );
}

void setup()
{
  Serial.begin(9600);

  // 初始化74HC4051多路開關的控制端
  pinMode(S0, OUTPUT);
  pinMode(S1, OUTPUT);
  pinMode(S2, OUTPUT);

  digitalWrite(S0, LOW);
  digitalWrite(S1, LOW);
  digitalWrite(S2, LOW);



  max6675_init();

  //  for (int i = 0; i < 8; i++) {
  //    thermocouples[i] = new MAX6675(6, zOutput, 5);  // 初始化每個溫度傳感器
  //    digitalWrite(zOutput, HIGH);
  //  }

  Serial.println("Y0\tY1\tY2\tY3\tY4\tY5\tY6\tY7");
  Serial.println("---\t---\t---\t---\t---\t---\t---\t---");
}

void loop()
{
  // 讀取第一個MAX6675模組的溫度數據

  max6675_init();
  delay(220);
  digitalWrite(S0, LOW);
  digitalWrite(S1, LOW);
  digitalWrite(S2, LOW);

  //初始化溫度轉換
//  digitalWrite( zOutput, LOW );
//  delay(2);
//  digitalWrite( zOutput, HIGH );
//  delay(220);
  //   開始溫度轉換
  digitalWrite( zOutput, LOW );

  //  float temp1 = analogRead(zInput); // and read Z
  float temp1 = max6675_getCelsius();

  Serial.print("Temp 1: ");
  Serial.print(temp1);
  delay(100);
  temp1 = 0;

  // 禁用与MAX6675的通信
//  digitalWrite( zOutput, HIGH );
//  digitalWrite( _SCK, LOW );
  delay(100);

  // 讀取第二個MAX6675模組的溫度數據

  max6675_init();
  delay(220);
  digitalWrite(S0, HIGH);
  digitalWrite(S1, LOW);
  digitalWrite(S2, LOW);

  //初始化溫度轉換
//  digitalWrite( zOutput, LOW );
//  delay(2);
//  digitalWrite( zOutput, HIGH );
//  delay(220);
  //   開始溫度轉換
  digitalWrite( zOutput, LOW );

  //  float temp2 = analogRead(zInput); // and read Z
  float temp2 = max6675_getCelsius();

  Serial.print(" C, Temp 2: ");
  Serial.print(temp2);
  delay(100);
  temp2 = 0;
  
  // 禁用与MAX6675的通信
//  digitalWrite( zOutput, HIGH );
//  digitalWrite( _SCK, LOW );
  delay(100);

  Serial.println(" C");
  delay(1000);
}


float max6675_getCelsius()
{
  uint16_t t_c = 0;

  //初始化溫度轉換
  //  digitalWrite( zOutput, LOW );
  //  delay(2);
  //  digitalWrite( zOutput, HIGH );
  //  delay(220);

  // 開始溫度轉換
//    digitalWrite( zOutput, LOW );

  // 15th-bit, dummy bit
  digitalWrite( _SCK, HIGH );
  delay(1);
  digitalWrite( _SCK, LOW );

  // 14th - 4th bits, temperature valuw
  for ( int i = 11; i >= 0; i-- )
  {
    digitalWrite( _SCK, HIGH );
    t_c += digitalRead( _SO ) << i;
    digitalWrite( _SCK, LOW );
  }

  // 3th bit, 此位元可以用來判斷 TC 是否損壞或是開路
  // Bit D2 is normally low and goes high when the therometer input is open.
  digitalWrite( _SCK , HIGH );
  is_tc_open = digitalRead( _SO );
  digitalWrite( _SCK, LOW );

  // 2nd - 1st bits,
  // D1 is low to provide a device ID for the MAX6675 and bit D0 is three-state.
  for ( int i = 1; i >= 0; i-- )
  {
    digitalWrite( _SCK, HIGH );
    delay(1);
    digitalWrite( _SCK, LOW );
  }

  // 關閉 MAX6675
  digitalWrite( zOutput, HIGH );

  return (float)(t_c * 0.25);
}

