import java.util.Scanner;

public class P04SumOfTwoNumbers {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        int start = Integer.parseInt(scanner.nextLine()); // 1
        int end = Integer.parseInt(scanner.nextLine()); // 10
        int magicNum = Integer.parseInt(scanner.nextLine());

        int count = 0;
        boolean flag = false;
        for (int i = start; i <= end; i++) {
            for (int j = start; j <= end; j++) {
                count++;

                int sum = i + j;
                if (sum == magicNum) {
                    flag = true;
                    System.out.printf("Combination N:%d (%d + %d = %d)%n", count, i, j, sum);
                    break;
                }
            }
            if (flag) {
                break;
            }
        }

        if (!flag) {
            System.out.printf("%d combinations - neither equals %d", count, magicNum);
        }
    }
}

class Solution {
public:
    bool isValid(string s) {
        
        if(s[0]=='0'){
            return false;
        }
        if(stoi(s)>26) {
            return false;
        }
        return true;
    }

    int f(string s, int currentSplit,vector<int> dp){

        if(dp[currentSplit]!=-1) {
            return dp[currentSplit];
        }
        
        if(currentSplit==0) { return 1;}
        if(currentSplit<0) { return 0;}
        
        int ans=0;

        if(currentSplit>=1 && isValid(s.substr(currentSplit-1,1))){
            ans+=f(s,currentSplit-1,dp);
        }
        if(currentSplit>=2 && isValid(s.substr(currentSplit-2,2))){
            ans+=f(s,currentSplit-2,dp);
        }
        return dp[currentSplit]=ans;


        

    }
    int numDecodings(string s) {
        
         vector<int>dp(s.length()+1,-1);
         return f(s,s.length(),dp);
    }
};

