import java.util.Scanner;

public class MouseCheeseHunt {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        String[] dimensions = scanner.nextLine().split(",");
        int rows = Integer.parseInt(dimensions[0]);
        int columns = Integer.parseInt(dimensions[1]);

        char[][] area = new char[rows][columns];
        int mouseRow = -1, mouseCol = -1;
        int cheeseCount = 0;

        for (int row = 0; row < rows; row++) {
            String input = scanner.nextLine();
            for (int col = 0; col < columns; col++) {
                char position = input.charAt(col);
                area[row][col] = position;

                if (position == 'M') {
                    mouseRow = row;
                    mouseCol = col;
                } else if (position == 'C') {
                    cheeseCount++;
                }
            }
        }

        String command;
        boolean trapEncountered = false;
        boolean dangerCommandReceived = false;

        while (true) {
            command = scanner.nextLine();
            if (command.equals("danger")) {
                dangerCommandReceived = true;
                break;
            }

            int newMouseRow = mouseRow;
            int newMouseCol = mouseCol;

            switch (command) {
                case "up":
                    newMouseRow--;
                    break;
                case "down":
                    newMouseRow++;
                    break;
                case "left":
                    newMouseCol--;
                    break;
                case "right":
                    newMouseCol++;
                    break;
            }

            if (newMouseRow < 0 || newMouseRow >= rows || newMouseCol < 0 || newMouseCol >= columns) {
                System.out.println("No more cheese for tonight!");
                break;
            }

            char newPosition = area[newMouseRow][newMouseCol];

            if (newPosition == '@') {
                continue; // Skip the command if it leads to a wall
            } else if (newPosition == 'C') {
                cheeseCount--;
                area[newMouseRow][newMouseCol] = '*';

                if (cheeseCount == 0) {
                    System.out.println("Happy mouse! All the cheese is eaten, good night!");
                    break;
                }
            } else if (newPosition == 'T') {
                trapEncountered = true;
            }

            area[mouseRow][mouseCol] = '*';
            area[newMouseRow][newMouseCol] = 'M';
            mouseRow = newMouseRow;
            mouseCol = newMouseCol;
        }

        if (trapEncountered) {
            System.out.println("Mouse is trapped!");
        } else if (dangerCommandReceived) {
            System.out.println("Mouse will come back later!");
        }

        // Print the final state of the matrix
        for (int row = 0; row < rows; row++) {
            for (int col = 0; col < columns; col++) {
                System.out.print(area[row][col]);
            }
            System.out.println();
        }
    }
}

